import React from 'react';
import Axios from 'axios';

class DeveloperinProject extends React.Component{
    constructor(props){
        super(props);
        this.state={data:[]}
    }

    componentWillReceiveProps(){
        Axios.get(`http://localhost:3002/getdeveloperinproject/${this.props.match.params.id}`).then(res=>{
            if(res.status===200)
                this.setState({data:res.data.developers})
        })
    }
    render(){
        console.log(this.state.data);
        const developer=this.state.data.map(i=>{
            return(
                <div style={{border:"1px solid black",width:"fit-content",marginTop:"2em",marginLeft:"26%",padding:"2% 2%"}}>
                <h4>i</h4>
             </div>
            )
        })
        return(
            {developer}
        )
    }
}
export default DeveloperinProject;
